paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 1:
        {
            value = (value < 0 ? 0 : (value > 11 ? 11 : value));
            let normalizedValue = (value - 0) / (11 - 0);

            {
                normalizedValue = this.applyStepsToNormalizedParameterValue(normalizedValue, 12);
            }

            return normalizedValue;
        }
    case 3:
        {
            value = (value < 0 ? 0 : (value > 100 ? 100 : value));
            let normalizedValue = (value - 0) / (100 - 0);
            return normalizedValue;
        }
    case 5:
        {
            value = (value < 50 ? 50 : (value > 250 ? 250 : value));
            let normalizedValue = (value - 50) / (250 - 50);
            return normalizedValue;
        }
    case 0:
        return value / 100;
    case 2:
        return value / 100;
    case 4:
        return value / 100;
    case 6:
        return (value + 1) / 2;
    default:
        index -= 7;

        if (index < this.p_01[0].getNumParameters()) {
            {
                return this.p_01[0].convertToNormalizedParameterValue(index, value);
            }
        }

        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 1:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                value = this.applyStepsToNormalizedParameterValue(value, 12);
            }

            {
                return 0 + value * (11 - 0);
            }
        }
    case 0:
    case 2:
    case 3:
    case 4:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (100 - 0);
            }
        }
    case 5:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 50 + value * (250 - 50);
            }
        }
    case 6:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return -1 + value * (1 - -1);
            }
        }
    default:
        index -= 7;

        if (index < this.p_01[0].getNumParameters()) {
            {
                return this.p_01[0].convertFromNormalizedParameterValue(index, value);
            }
        }

        return value;
    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 100 ? 100 : (v < 0 ? 0 : v));
            return v;
        }
    case 1:
        {
            v = (v > 11 ? 11 : (v < 0 ? 0 : v));

            {
                const oneStep = 11 / 11;
                const oneStepInv = (oneStep != 0 ? 1 / oneStep : 0);
                const numberOfSteps = rnbo_fround(v * oneStepInv * 1 / 1) * 1;
                v = numberOfSteps * oneStep;
            }

            return v;
        }
    case 2:
        {
            v = (v > 100 ? 100 : (v < 0 ? 0 : v));
            return v;
        }
    case 3:
        {
            v = (v > 100 ? 100 : (v < 0 ? 0 : v));
            return v;
        }
    case 4:
        {
            v = (v > 100 ? 100 : (v < 0 ? 0 : v));
            return v;
        }
    case 5:
        {
            v = (v > 250 ? 250 : (v < 50 ? 50 : v));
            return v;
        }
    case 6:
        {
            v = (v > 1 ? 1 : (v < -1 ? -1 : v));
            return v;
        }
    default:
        index -= 7;

        if (index < this.p_01[0].getNumParameters()) {
            {
                return this.p_01[0].constrainParameterValue(index, value);
            }
        }

        return value;
    }
}

